public class Main {
    public static void main(String[] args) {
        String str = "";
        String r = "";
        int a = 0;

        for (int i = 0; i < str.length(); i++) {
            r = String.valueOf(str.charAt(i));
            if (r.toLowerCase().equals("a")) {
                a++;
            }
        }
        System.out.println(a);
    }
}